// src/components/ServiceOverview.js
import React from "react";
import './ServiceOverview.css';  // Your styles for this section

const ServiceOverview = () => {
  return (
    <div className="service-overview">
      <h2>Our Services</h2>
      <div className="services">
        <div className="service">
          <h3>Wedding Planning</h3>
          <p>End-to-end planning for a flawless wedding.</p>
        </div>
        <div className="service">
          <h3>Vendor Management</h3>
          <p>We manage everything from photographers to florists.</p>
        </div>
        <div className="service">
          <h3>Event Coordination</h3>
          <p>Perfect coordination for a seamless wedding day.</p>
        </div>
      </div>
    </div>
  );
};

export default ServiceOverview;
